int n, k, tc;

void BruteForceMedian(int A[], int n, int k)
{
    /*
     According to the pseudocode, the value of K will be K = |n/2|,
     which is the ceiling value of K in arrays with both even and odd number of elements.
     K is a global variable so each time that the function is called,
     K's value depends on the n value, which is the number of elements of the array.
     The ceiling function selects the upper bound of the two elements in an even array.
     */
    k = ceil(n / 2);
    
    
    
    //Timer
    std::clock_t start;
    double duration;
    start = std::clock();
    
    //Counter variable
    int basicOpsCounter = 0;
    
    for (int i = 0; i <= (n - 1); i++)
    {
        int numsmaller = 0;
        int numequal = 0;
        
        /*Entering a loop is counted as a basic operation as the for loop traverses the array*/
        basicOpsCounter++;
        
        for (int j = 0; j <= (n - 1); j++)
        {
            if (A[j] < A[i])
            {
                numsmaller = numsmaller + 1;
                
                basicOpsCounter++; //Basic operation of comparison of values
            }
            else if (A[j] == A[i])
            {
                numequal = numequal + 1;
                
                basicOpsCounter++; //Basic operation of comparison of values
            }
        }
        
        if ((numsmaller < k) && (k <= numsmaller + numequal))
        {
            basicOpsCounter++; //Basic operation of comparison of values
        }
    }
    //OUTPUT
    {
       /*std::cout << "Sorted array: ";
        for (int l = 0; l <= n; l++)
            std::cout << A[l] << " ";
        std::cout << "\n";*/
        
        /*affecting the efficiency of the array as larger array lengths increase the completion time,
         there is an extra few seconds used by the program to display the values of the sorted array to the console.*/
        
        std::cout << "Median: " << A[k] << "\n";
        
        std::cout << "Basic operations: " << basicOpsCounter << " \n";
        
        duration = (std::clock() - start) / (double)CLOCKS_PER_SEC;
        std::cout << "Time: " << duration << "\n\n\n";
    }
}

